async function updateServiceStatus(e,t){try{var r=await(await fetch(t)).json(),i=parseFloat(r.ping_time),s=document.getElementById(e),a=s.querySelector("span"),o=s.querySelector("status-indicator");a.textContent=i+"ms",o.removeAttribute("positive"),o.removeAttribute("intermediary"),o.removeAttribute("negative"),i<35?o.setAttribute("positive",""):35<=i&&i<70?o.setAttribute("intermediary",""):o.setAttribute("negative","")}catch(t){console.error(`Error fetching data for ${e}:`,t)}}function initServices(){[{id:"service-1",url:"https://api.fxtelekom.org/status/cloudflare"},{id:"service-2",url:"https://api.fxtelekom.org/status/gcore"},{id:"service-3",url:"https://api.fxtelekom.org/status/valve-cs2"},{id:"service-4",url:"https://api.fxtelekom.org/status/tarkov"},{id:"service-5",url:"https://api.fxtelekom.org/status/websupportsk"},{id:"service-6",url:"https://api.fxtelekom.org/status/hunt"}].forEach(t=>{updateServiceStatus(t.id,t.url)})}initServices(),setInterval(initServices,6e4);